import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 24,
    backgroundColor: '#131016',
  }, 
  eventName: {
    color: '#FFF',
    fontSize: 24,
    marginTop: 24,
    fontWeight: 'bold',
  }, 
  eventDate: {
    color: '#6B6B6B',
  }
})
